                    <li><a>  Smart payment page    </a> </li>
                    <li><a>  Custom UI toolkit     </a> </li>
                    <li><a>  Clean canvas          </a> </li>
                </ul>
            </Column>

            <Column>  
                <div className="Process"><SubTitles title="Process"/></div>            
            <ul>
            <li className="groupHeader"><a>Customer interfaces</a></li>
            <li><a>  Smart payment page    </a> </li>


            <li className="groupHeader"><a>Customer interfaces</a></li>
